package strrev

import "testing"

func BenchmarkReverseEmpty(b *testing.B) {
	for i := 0; i < b.N; i++ {
		Reverse(emptyString)
	}
}

func BenchmarkReverseShort(b *testing.B) {
	for i := 0; i < b.N; i++ {
		Reverse(shortString)
	}
}

func BenchmarkReverseLong(b *testing.B) {
	for i := 0; i < b.N; i++ {
		Reverse(longString)
	}
}

func BenchmarkReverseBytesEmpty(b *testing.B) {
	for i := 0; i < b.N; i++ {
		ReverseBytes(emptyBytes)
	}
}

func BenchmarkReverseBytesShort(b *testing.B) {
	for i := 0; i < b.N; i++ {
		ReverseBytes(shortBytes)
	}
}

func BenchmarkReverseBytesLong(b *testing.B) {
	for i := 0; i < b.N; i++ {
		ReverseBytes(longBytes)
	}
}

const emptyString = ""
const shortString = "abcdefg"
const longString = ""

var emptyBytes = []byte(emptyString)
var shortBytes = []byte(shortString)
var longBytes = []byte(longString)
